import { Component, OnDestroy, OnInit } from '@angular/core';
import { Subscription } from 'rxjs';


declare var parseReplay: any;

@Component({
  selector: 'app-user',
  templateUrl: './user.component.html'
})
export class UserComponent implements OnInit, OnDestroy {
  message: any;
  subscription: Subscription = new Subscription;

  constructor(private data: SendFileService) { }
  ngOnInit(): void {
    this.subscription = this.data.currentMessage.subscribe((message: any) => this.message = message);
    console.log(this.message);
    var file = this.message[0].fileName;
    new parseReplay(file);
  }

  ngOnDestroy(): void {
      this.subscription.unsubscribe();
  }

}
